import PostDetail from './PostDetail';
const PostList = (props) => {
  const renderPosts = () => {
    return props.postsList.map((post) => {
      if (post.country === 'Jordania') {
        return (
          <li>
            <PostDetail postItem="valor" />
          </li>
        );
      }
      return (
        <li>
          <PostDetail postItem={post} />
        </li>
      );
    });
  };
  return (
    <section>
      <h2>Listados de post</h2>
      <ul> {renderPosts()}</ul>
    </section>
  );
};
export default PostList;
